import React from "react";
import Home from "./Componet/Home/Home";
import Navbar from "./Componet/Navbar/Navbar";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import About from "./Componet/About/About";
import Authors from "./Componet/Authors/Authors";
import AddAuthor from "./Componet/AddAuthors/AddAuthor";
import UpdateAuthor from "./Componet/UpdateAuthor/UpdateAuthor";
import ManageAuthor from "./Componet/ManageAuthor/ManageAuthor";
import {Provider} from 'react-redux';
import configureStore from './Store/Store';

function App() {
  return ( 
    <Provider store={configureStore()}>
     <Router> 
      <Navbar />
      <Switch>
        <Route exact path="/Home" component={Home} />
        <Route exact path="/About" component={About} />
        <Route exact path="/Authors" component={Authors} />
        <Route exact path="/ManageAuthor" component={ManageAuthor}/>
        <Route exact path="/UpdateAuthor/:id" render={props=>(
          <UpdateAuthor{...props}/>
        )}/>
        <Route exact path="/AddAuthor" component={AddAuthor} />
      </Switch>
    </Router>
    </Provider>

  )

}

export default App;
